import os

# Define the base directory for cloudbed-1 on March 21, 2022
base_dir = 'dataset/Market/cloudbed-1/telemetry/2022_03_21/metric/'

# List all metric files
def list_metric_files(base_dir):
    metric_files = []
    for file in os.listdir(base_dir):
        if file.startswith('metric_') and file.endswith('.csv'):
            metric_files.append(file)
    return metric_files

# Get distinct KPI names for each metric file
def get_distinct_kpis(file_path):
    df = pd.read_csv(file_path)
    if 'kpi_name' in df.columns:
        return df['kpi_name'].unique().tolist()
    else:
        return []

# Execute
metric_files = list_metric_files(base_dir)
print("Available metric files:", metric_files)

# Create a dictionary to store KPIs for each file
kpi_dict = {}
for file in metric_files:
    file_path = os.path.join(base_dir, file)
    kpis = get_distinct_kpis(file_path)
    kpi_dict[file] = kpis
    print(f"\nDistinct KPIs in {file}:", kpis)

# Store the results for later use
metric_files, kpi_dict

